import React from 'react';

const changeColor = {};

const bgChange = ()=>{
    console.log('hello');
    changeColor.backgroundColor = 'purple';
}

const App = ()=>{
    return (
        <>
        <div style = {changeColor}>
        <button onClick = {bgChange}>Click Me</button>
        </div>
        </>
    );
}


export default App;
